import Reactc, { useState } from "react";
import Image from "./image";
import { Input } from "../form/input-fields/primary-input";
import Link from 'next/link'
import { ContentWrapper, CustomButton, ContentContainer, HeaderContainer, CenteredForm, FormContainer, Avatar, NavLink, Title, SubTitle, InputContainer } from "./elements";
import styled from "styled-components";
import colors from ".././../theme/main/colors";

const LinkWithLine = styled("a")`
color:${colors.primary};

}
`;

const TitleContainer = styled("div")`
margin-top:-20px;
margin-bottom:20px;

}
`;


const Signup = () => {

    return (
        <>
            <ContentWrapper>
                <Image />
                <FormContainer>
                    <CenteredForm>
                        <HeaderContainer>
                            <Title>Signup with Taxiye</Title>
                            <SubTitle>Tell us who you are. Please enter your correct detail below</SubTitle>
                        </HeaderContainer>
                        <ContentContainer>
                            <InputContainer>
                                <Input
                                    label="First Name *"
                                    placeholder="John"
                                    id="firstname" />
                            </InputContainer>
                            <InputContainer>
                                <Input
                                    label="Last Name *"
                                    placeholder="Doe"
                                    id="lastname" />
                            </InputContainer>
                            <InputContainer>
                                <Input
                                    label="Email Address *"
                                    placeholder="Johndoe@gmail.com"
                                    id="emailaddress" />
                            </InputContainer>
                            <TitleContainer>
                            <SubTitle>I agree to Taxiye's <LinkWithLine href="/">Terms of service</LinkWithLine></SubTitle>
                            </TitleContainer>
                            <CustomButton>Create account</CustomButton>
                              </ContentContainer>
                    </CenteredForm>
                </FormContainer>


            </ContentWrapper>
        </>
    );
};

export default Signup;
